'''
Given a string s, you are allowed to convert it to a palindrome by adding characters in front of it. Find and return the shortest palindrome you can find by performing this transformation.

Example 1:

Input: "aacecaaa"
Output: "aaacecaaa"
Example 2:

Input: "abcd"
Output: "dcbabcd"
'''



class Solution(object):
    def shortestPalindrome(self, s):
        """
        :type s: str
        :rtype: str
        """
        if len(s) < 2:
            return s

        ss = s + '#' + s[::-1]
        print(ss)
        lps = self.findKMPArray(ss)
        print(lps)

        longestLength = lps[len(ss) - 1]
        
        longestLength = min(len(s), lps[len(ss) - 1])
        return s[len(s):(longestLength-1):-1] + s

    def findKMPArray(self, s):
        '''
        Longest length of a prefix of a sub string of s ending at index i, which is also sufixx of the sub string.
        aka. longest proper prefix
        '''
        lps = [0] * len(s)
        for i in range(1, len(s)):
            preLen = lps[i - 1]
            foundMatch = True
            while s[i] != s[preLen]:
                if preLen == 0:
                    ## can not find any match. default length is 0
                    foundMatch = False
                    break
                else:
                    preLen = lps[preLen - 1]
            if foundMatch:
                lps[i] = preLen + 1

        return lps


    def shortestPalindrome2(self, s):
        """
        :type s: str
        :rtype: str
        """
        if len(s) < 2:
            return s

        shortedIdx = self.findShortestIndex(s)
        if shortedIdx == len(s) - 1:
            return s
        else:
            return s[(len(s)-1):shortedIdx:-1] + s

    def findShortestIndex(self, s):
        for endIdx in range(len(s) - 1, 0, -1):
            if self.isPalindrome(s, 0, endIdx):
                return endIdx

        return 0

    def isPalindrome(self, s, lo, hi):
        while lo < hi:
            if s[lo] != s[hi]:
                return False
            else:
                lo += 1
                hi -= 1

        return True
    

    @staticmethod
    def main():
        sol = Solution()
        s = ""
        print(sol.shortestPalindrome(s))

